import { Component } from '@angular/core';

@Component({
  selector: 'app-thongbao',
  templateUrl: './thongbao.component.html',
  styleUrls: ['./thongbao.component.css']
})
export class ThongbaoComponent {

}
<!DOCTYPE html>
<html>
<head>
	<meta charset="utf-8">
	<meta name="viewport" content="width=device-width, initial-scale=1">
	<title></title>
    <script>
	// Lấy tất cả các nút Xem, Sửa trạng thái và Gửi thông báo
    var viewButtons = document.querySelectorAll('.view-btn');
    var editButtons = document.querySelectorAll('.edit-btn');
    var sendNotificationButtons = document.querySelectorAll('.send-notification-btn');

    // Đăng ký sự kiện click cho các nút Xem
    for (var i = 0; i < viewButtons.length; i++) {
        viewButtons[i].addEventListener('click', function() {
            // Mã đơn hàng được lấy từ thuộc tính data-order-id của nút
            var orderId = this.getAttribute('data-order-id');
            alert('Xem đơn hàng ' + orderId);
        });
    }

    // Đăng ký sự kiện click cho các nút Sửa trạng thái
    for (var i = 0; i < editButtons.length; i++) {
        editButtons[i].addEventListener('click', function() {
            // Mã đơn hàng được lấy từ thuộc tính data-order-id của nút
            var orderId = this.getAttribute('data-order-id');
            alert('Sửa trạng thái đơn hàng ' + orderId);
        });
    }

    // Đăng ký sự kiện click cho các nút Gửi thông báo
    for (var i = 0; i < sendNotificationButtons.length; i++) {
        sendNotificationButtons[i].addEventListener('click', function() {
            // Mã đơn hàng được lấy từ thuộc tính data-order-id của nút
            var orderId = this.getAttribute('data-order-id');
            alert('Gửi thông báo cho đơn hàng ' + orderId);
        });
    }


    </script>
  <style>
    .button-group {
			display: flex;
			justify-content: center;
			align-items: center;
			margin-bottom: 20px;
		  }

		  .button {
			display: inline-block;
			padding: 10px;
			font-size: 16px;
			background-color: #008CBA;
			color: white;
			border: none;
			text-decoration: none;
			margin-right: 10px;
			cursor: pointer;
		  }

		  .button:hover {
			background-color: #006B8F;
		  }
      .search-container {
        display: flex;
        justify-content: flex-end;
        margin-top: 20px;
      }

      input[type=text] {
        width: 250px;
        padding: 10px;
        font-size: 16px;
        border: none;
        border-bottom: 2px solid #ccc;
      }

      button[type=submit] {
        padding: 10px;
        font-size: 16px;
        background-color: #008CBA;
        color: white;
        border: none;
        cursor: pointer;
      }

      button[type=submit]:hover {
        background-color: #006B8F;
      }
      .center {
        display: flex;
        justify-content: center;
        align-items: center;
        height: 200px;
        background-color: #eee;
      }

      .center p {
        text-align: center;
        font-size: 24px;
        color: #333;
      }
      table {
        border-collapse: collapse;
        width: 100%;
    }
    th, td {
        text-align: left;
        padding: 8px;
    }
    tr:nth-child(even) {
        background-color: #f2f2f2;
    }
    th {
        background-color: #4CAF50;
        color: white;
    }
    button {
        background-color: #4CAF50;
        color: white;
        border: none;
        padding: 8px 16px;
        text-align: center;
        text-decoration: none;
        display: inline-block;
        font-size: 16px;
        margin: 4px 2px;
        cursor: pointer;
    }
    .container {
        max-width: 800px;
        margin: 0 auto;
    }
  </style>
</head>
<body>
  <div class="button-group">
    <a routerLink="/create-supplier" class="button">Tạo mới khách hàng</a>
    <a routerLink="/create-category" class="button">Thêm danh mục</a>
    <a routerLink="/create-category" class="button">In dữ liệu</a>


  </div>
  <div class="search-container">
    <form action="/search">
      <input type="text" placeholder="Nhập từ khóa tìm kiếm" name="search">
      <button type="submit"><i class="fa fa-search"></i>Tìm Kiếm</button>
    </form>
  </div>
  <div class="center">
		<p>Quản Lý Đơn Hàng</p>
	</div>
    <div class="container">
		<h1>Quản lý đơn hàng</h1>
		<h2>Danh sách đơn hàng</h2>
		<table>
			<thead>
				<tr>
					<th>Mã đơn hàng</th>
					<th>Ngày đặt hàng</th>
					<th>Trạng thái</th>
					<th></th>
				</tr>
			</thead>
			<tbody>
				<tr>
					<td>001</td>
					<td>01/01/2023</td>
					<td>Đã giao hàng</td>
					<td>
						<button class="view-btn" data-order-id="001">Xem</button>
						<button class="edit-btn" data-order-id="001">Sửa trạng thái</button>
						<button class="send-notification-btn" data-order-id="001">Gửi thông báo</button>
					</td>
				</tr>
				<tr>
					<td>002</td>
					<td>02/01/2023</td>
					<td>Chưa giao hàng</td>
					<td>
						<button class="view-btn" data-order-id="002">Xem</button>
						<button class="edit-btn" data-order-id="002">Sửa trạng thái</button>
						<button class="send-notification-btn" data-order-id="002">Gửi thông báo</button>
					</td>
				</tr>
				<!-- Các đơn hàng khác -->
			</tbody>
		</table>
		<h2>Danh sách đơn hàng đã nhận hàng</h2>
		<table>
			<thead>
				<tr>
					<th>Mã đơn hàng</th>
					<th>Ngày đặt hàng</th>
					<th>Trạng thái</th>
				</tr>
			</thead>
			<tbody>
				<tr>
					<td>003</td>
					<td>03/01/2023</td>
					<td>Đã nhận hàng</td>
				</tr>
				<tr>
					<td>004</td>
					<td>04/01/2023</td>
					<td>Đã nhận hàng</td>
				</tr>
				<!-- Các đơn hàng khác -->
			</tbody>
		</table>
	</div>
<body>
<html>
